const React = require('react');
const AppLayout = require('./layouts/AppLayout.jsx')

class Index extends React.Component{
  render() {
    return (
      <AppLayout title="My Library">
        <div className="container d-flex justify-content-around">
        {this.props.games.map(
          (game, index) => {
              return (
                <div className="col-cm-3">
                    <div className="card bg-info">
                        <div className="card-header">
                            <a href={`/${game._id}`}>{game.name}</a>
                        </div>
                        <div className="card-body">
                            <img className="card-img-top" src= {`${game.img}`} alt={`image of ${game.name}`}/>
                        </div>

                    </div>
                  {/* <a href={`/restaurants/${restaurant._id}`}>
                    <span class="name">{restaurant.name}</span>
                    <span class="owner">{restaurant.owner}</span>
                    <span class="type">{restaurant.type}</span>
                    <span class="capacity">{restaurant.capacity}</span>
                  </a> */}
                </div>
              )}
        )}
        </div>
      </AppLayout>

    )
  }
}
module.exports= Index ;
